function initMap(){var e={lat:39.7219538,lng:-91.5098444},t=new google.maps.Map(document.getElementById("map"),{zoom:4,center:e});new google.maps.Marker({position:e,map:t,icon:"assets/img/location.svg"})}const tabLinks=document.querySelectorAll(".tabs a"),tabPanels=document.querySelectorAll(".tabs-panel");for(let s of tabLinks)s.addEventListener("click",e=>{e.preventDefault(),document.querySelector(".tabs li.active").classList.remove("active"),document.querySelector(".tabs-panel.active").classList.remove("active");const t=s.parentElement;t.classList.add("active");const a=[...t.parentElement.children].indexOf(t),n=[...tabPanels].filter(e=>e.getAttribute("data-index")==a);n[0].classList.add("active")});